 The entity is 7 bits long. The arraybuffer will be 1 byte long for every 8 entities.

Here is a simple example of how you could implement the pack and unpack functions in JavaScript:
```javascript
function packEntities(entities) {
  const arrayBuffer = new ArrayBuffer(Math.ceil(entities.length / 8));
  const dataView = new DataView(arrayBuffer);

  let offset = 0;
  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id;
    const size = entity.size;

    // Pack id (4 bits) and size (3 bits) into a single byte
    const packedValue = (id << 3) | size;

    // Write the packed value to the array buffer
    dataView.setUint8(offset, packedValue);

    // Increment the offset by 1 byte (since we're packing 8 entities per byte)
    offset += 1;
  }

  return arrayBuffer;
}

function unpackEntities(arrayBuffer) {
  const dataView = new DataView(arrayBuffer);
  const entities = [];

  for (let i = 0; i < arrayBuffer.byteLength; i++) {
    const packedValue = dataView.getUint8(i);

    // Unpack id (4 bits) and size (3 bits) from the packed value
    const id = packedValue >> 3;
    const size = packedValue & 0x7;

    // Create a new entity object with the unpacked id and size
    const entity = { id, size };

    // Add the entity to the array of entities
    entities.push(entity);
  }

  // Since we're unpacking 8 entities per byte, we need to repeat the process
  // for each byte in the array buffer
  return entities;
}
```
